import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import { Link } from "react-router-dom";
import Button from "@mui/material/Button";
import { makeStyles } from "@mui/styles";

// const API_KEY=process.env.REACT_APP_WEATHER_API_KEY

const backgroundImg='https://images.unsplash.com/photo-1610892415063-d89a504ce049'
const useStyles = makeStyles(() => ({
  form: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    marginTop: "5%",
    marginLeft: "40%",
    backgroundImage: `url(${backgroundImg})`,
    backgroundSize: "cover", // Adjust as needed
    minHeight: "80vh",
    width: "500px", 
    justifyContent: "center",
    padding: 4,
  },
  input: {
    marginBottom: 2,
    marginBlockStart: 20,
    width: "300px",
  },
  button: {
    borderRadius: "20px", 
    marginTop: "20px",
  },
}));




interface Country {
  name?: {
    common?: string;
    official?: string;
  };
  capital?: string[];
  population?: number;
  latlng?: number[];
  flags?: {
    png?: string;
    svg?: string;
    alt?: string;
  };
}

const CountryInfo = () => {
  const { name } = useParams();
  const [countryData, setCountryData] = useState<Country>({});
  const [weatherData, setWeatherData] = useState<any>({});
  const navigate = useNavigate();
  const API_KEY = "e3736c59809579a0c2080ae39ebc7d67";
  useEffect(() => {
    const fetchCountryData = async () => {
      try {
        const response = await fetch(
          `https://restcountries.com/v3.1/name/${name}?fullText=true`
        );
        const data = await response.json();
        setCountryData(data[0]);
        if (!response.ok) {
          alert("Enter Correct Country Name OR Error Occured While Fetching Data");
          navigate(`/`);
        }
      } catch (error) {
        console.error("Error fetching country data:", error);
      }
    };

    fetchCountryData();
  }, [name, navigate]);

  const fetchWeatherData = async () => {
    try {
      const response = await axios.get(
        `https://api.openweathermap.org/data/2.5/weather?lat=${countryData.latlng?.[0]}&lon=${countryData.latlng?.[1]}&appid={API_KEY}`
      );
      setWeatherData(response.data);
    } catch (error) {
      console.error("Error fetching weather data:", error);
    }
  };

  useEffect(() => {
    console.log("countryData updated:", countryData);
    console.log("weatherData updated:", weatherData);
    console.log("Api KEys", API_KEY);
    if (countryData.latlng) {
      fetchWeatherData();
    }
  }, [countryData]);

  if (!countryData.name) {
    return <div>Loading...</div>;
  }

  const renderWeatherData = () => {
    return (
      <div>
        <h2>Weather Information:</h2>
        <p>
          <strong>Temperature:</strong> {weatherData.main?.temp - 273.15} Celsius
        </p>
        <p>
          <strong>Wind Speed:</strong> {weatherData.wind?.speed} meter/sec
        </p>
      </div>
    );
  };

  return (
    <div>
      <h1>
        Welcome to the Country Data
        <Link to="/">Home</Link>
      </h1>

      <p>
        <strong>Name:</strong> {countryData.name.common}
      </p>
      <p>
        <strong>Capital:</strong> {countryData.capital?.[0]}
      </p>
      <p>
        <strong>Population:</strong> {countryData.population}
      </p>
      <p>
        <strong>Latitude/Longitude:</strong> {countryData.latlng?.join(", ")}
      </p>
      <p>
        <strong>Flag:</strong>{" "}
        <img
          src={countryData.flags?.png}
          alt={`Flag of ${countryData.name.common}`}
        />
      </p>
      <button onClick={fetchWeatherData}>Capital Weather</button>
      {weatherData && renderWeatherData()}
    </div>
  );
};

export default CountryInfo;
